import "./App.css";
import SignUp from "./components/signup";
import SignIn from "./components/signin";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route path="/login" element={<SignIn />} />
    </Routes>
  );
}

export default App;
